import { Component } from "react";

class MyFooter extends Component {
  render() {
    return (
      <footer className="bg-dark text-light">
        <div className="container">
          <div className="row">
            <div className="col-4">
              <h6>Contacts</h6>
            </div>
            <div className="col-4">
              <h6>Products</h6>
            </div>
            <div className="col-4">
              <h6>Useful Links</h6>
            </div>
          </div>
        </div>
      </footer>
    );
  }
}

export default MyFooter;
